import { mediaStoreAction } from '../reducers/mediaStore';

export const setMediaAction = () => {
  return (dispatch) => {
    try {
       dispatch(mediaStoreAction.setMedia([{ name: 'text' }]));
    } catch (error) {
      console.log(error);
    }
  };
};
